  false,\n\t\"url\": null,\n\t\"notes\": \"The NEFSC Food Habits Database has two
  major sources of data. The first, and most extensive, is the standard NEFSC Bottom
  Trawl Surveys Program. During these surveys, food habits data are collected for
  a variety of species. Additionally, \"process-oriented\" cruises are conducted periodically
  to address specific questions related to the feeding ecology of the fish in the
  ecosystem.nnBoth sources provide primarily stomach content information; composition,
  total and individual prey weights or volumes, and length of prey. Additional information
  associated with each fish predator is also collected. Other databases encompass
  the prey fields of these fish, and include zooplankton, ichthyoplankton, and benthic
  surveys.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
